<>
<h1> **Project Name: { project}** </h1>
<ul>
    <li> Addition:  {5+5}  </li>
    <li> Subtraction:   {15-5}  </li>
    <li> Multiplication:    {5*5}  </li>
    <li> Division:   {10/2} </li>
</ul>
</> , document.getElementById("root"));

import { add, div } from './Heading'

